import { config } from "./config"
import { defaultScene } from "./defaulfScene"

const DGO = () => {
  return {
    type: `gameObject`,
    transform: {
      position: {
        x: 0,
        y: 0
      },
      rotation: {
        z: 0
      },
      scale: {
        x: 1,
        y: 1
      }
    }
  }
}

export const files = {
  type: `folder`,
  scenes: {
    type: `folder`,
    defaultScene
  },
  engineAssets: {
    type: `folder`,
    tempImage: {
      type: `image`,
      value: {
        src: `data:image/png;base64`,
        width: 1,
        height: 1
      },
    }
  },
  folder1: {
    type: `folder`,
    object2: {
      type: `text`,
      value: `str 2`
    },
    obj3: {
      type: `folder`,
      obj4: {
        type: `text`,
        value: `str 3`
      },
      obj5: {
        type: `text`,
        value: `str 4`
      }
    }
  },
  folder2: {
    type: `folder`,
    object2: {
      type: `text`,
      value: `str 5`
    },
    obj2: {
      type: `folder`,
      obj4: {
        type: `text`,
        value: `str 5`
      },
      obj5: {
        type: `text`,
        value: `str 8`
      }
    }
  },
  config
}
